async function fillDatabase () {
  let cancel = false;
  await require('../functions/utils/instantiate-database')()
  let Place = require('../functions/models/place.model');
  await Place.find()
    .then(data => {
      if (data.length > 0) cancel = true;
    });

  if (cancel){
    console.log("DB data already loaded!");
    return;
  }


  const Visitor = require('../functions/models/visitor.model')
  let userId = await new Visitor({
    priorityId: 0,
    favourites: []
  }).save()
    .then(res => {
      return res._id
    })

  let PlaceType = require('../functions/models/place.type.model');
  new PlaceType({
    _id: 0,
    name: 'Park'
  }).save()

  new PlaceType({
    _id: 1,
    name: 'Museum'
  }).save()

  let placeIds = []

  await new Place({
    name: 'Central Park',
    placeTypeId: 0,
    imageData: Buffer.from('', 'base64'),
    description: 'Lorem ipsum dolor sit amet, consectetur adipiscing elit. Integer malesuada ante non nisl viverra eleifend. Sed consectetur justo quis lectus ullamcorper, et convallis augue ultricies. Donec felis orci, imperdiet eget pharetra sit amet, commodo vehicula lorem. Maecenas tristique gravida nisi. Quisque et velit eget dolor tempor dictum vel at purus.',
    url: 'https://central-park.com',
    address: 'Central Park, London',
    coordinates: '51.5293175,0.0505747'
  }).save().then(res => placeIds.push(res._id))

  await new Place({
    name: 'History Museum',
    placeTypeId: 1,
    imageData: Buffer.from('', 'base64'),
    description: 'Lorem ipsum dolor sit amet, consectetur adipiscing elit. Integer malesuada ante non nisl viverra eleifend. Sed consectetur justo quis lectus ullamcorper, et convallis augue ultricies. Donec felis orci, imperdiet eget pharetra sit amet, commodo vehicula lorem. Maecenas tristique gravida nisi. Quisque et velit eget dolor tempor dictum vel at purus.',
    url: 'https://history-museum.com',
    address: 'History Museum, London',
    coordinates: '51.496715,-0.1785559'
  }).save().then(res => placeIds.push(res._id))

  await new Place({
    name: 'South Park',
    type: 0,
    imageData: Buffer.from('', 'base64'),
    description: 'Lorem ipsum dolor sit amet, consectetur adipiscing elit. Integer malesuada ante non nisl viverra eleifend. Sed consectetur justo quis lectus ullamcorper, et convallis augue ultricies. Donec felis orci, imperdiet eget pharetra sit amet, commodo vehicula lorem. Maecenas tristique gravida nisi. Quisque et velit eget dolor tempor dictum vel at purus.',
    url: 'https://south-park.com',
    address: 'South Park, London',
    coordinates: '51.4693849,-0.1970964'
  }).save().then(res => placeIds.push(res._id))

  let SlotTypes = require('../functions/utils/slot-types');
  let Slot = require('../functions/models/slot.model');
  let moment = require('moment');

  let slotIds = []
  for (let i = 0; i <= 2; i++) {
    let startDate = moment('02062020 100000', 'DDMMYYYY hhmmss');
    let endDate = moment('02062020 110000', 'DDMMYYYY hhmmss');
    for (let j = 0; j < 6; j++) {
      let occupiedSlots = 0;
      if (i === j) occupiedSlots = 2;
      if (i === 1 && j === 4) occupiedSlots = 3;
      await new Slot({
        placeId: placeIds[i],
        typeId: j % 3 === 0 ? SlotTypes.slots().STANDARD.id : SlotTypes.slots().PRIORITY.id,
        starts: startDate.toDate(),
        ends: endDate.toDate(),
        occupiedSlots: occupiedSlots,
        maxVisitors: 20*i
      }).save().then(res => slotIds.push(res._id))
      startDate = startDate.add(1, 'hour');
      endDate = endDate.add(1, 'hour');
    }
  }

  let Booking = require('../functions/models/booking.model');
  new Booking({
    slotId: slotIds[0],
    visitorId: userId,
    friendsNumber: 2
  }).save();
  new Booking({
    slotId: slotIds[1],
    visitorId: userId,
    friendsNumber: 2
  }).save();
  new Booking({
    slotId: slotIds[2],
    visitorId: userId,
    friendsNumber: 2
  }).save();
  new Booking({
    slotId: slotIds[3],
    visitorId: userId,
    friendsNumber: 3
  }).save();
  console.log('Database filled!');
}

fillDatabase();